import React, { useState, useEffect } from 'react';
import Container from '@material-ui/core/Container';





const Post = (props) => {


	const [datas, setDatas] = useState({ 

		Gene: "",
		Impact:"",
		Variant_Description:'',
		Associated_with_drug_Resistance:"",
		Protein_Effect:'',
		Variant: ""





	 });

	const getData = async () => {
		const PostID = props.match.params.PostID;
		const URL = `http://127.0.0.1:8000/api/post/${PostID}/`;

		const response = await fetch(URL);
		const data = await response.json();

		setDatas(data);
	};

	useEffect(() => {
		getData();
	}, []);


	return (
		<Container component="main" maxWidth="md">

			<br/>
			<div >
				<Container maxWidth="sm">
					<h4>
						<span>{datas.Gene}</span>
						<span>{datas.Protein_Effect}</span>
						<span>{datas.Impact}</span>
						<span>{datas.Variant_Description}</span>
						<span>{datas.Variant}</span>
						<span>{datas.Associated_with_drug_Resistance}</span>
					</h4>

				</Container>
			</div>
		</Container>
	);
}


export default Post
